<!DOCTYPE html>
<html>
<head>
<style>
* {
  box-sizing: border-box;
}

/* Create two equal columns that floats next to each other */
.column {
  float: left;
  width: 50%;
  padding: 10px;
  /*height: 300px; /* Should be removed. Only for demonstration */
}

/* Clear floats after the columns */
.row:after {
  content: "";
  display: table;
  clear: both;
}

/* Responsive layout - makes the two columns stack on top of each other instead of next to each other */
@media screen and (max-width: 600px) {
  .column {
    width: 100%;
  }
}

</style>
</head>
<body onload=checkURI()>

<h1>Investment Property Rental Return</h1>

<p id="initialHelpText">Please enter the property information you would like to analyze below, your return will be calculated automatically</p>

<p id="feedbackBox"></p>

<label for="PTCF"></label><h3 id="PTCF"></h3>

<div class="row">
  <div class="column" style="background-color:#aaa;">
    <h2>Income</h2>
    <label for="purchase">Property Type: </label><select id="purchase">
      <option value="1">New Purchase</option>
      <option value="0">Existing Rental</option>
    </select><br />
    <label for="market">Market Price: $</label><input type="number" id="market" value="335000" style="width: 70px;"><br />
    <label for="price">Purchase Price: $</label><input type="number" id="price" value="335000" style="width: 70px;"><br />
    <label for="zip">Zip Code: </label><input type="number" id="zip" value="75075" style="width: 60px;"><br />
    <label for="rent">Est. Rent: $</label><input type="number" id="rent" value="1" style="width: 55px;">/mo<br />
    <label for="vacancy">Vacancy: </label> <input type="number" id="vacancy" value="3.29" style="width: 50px;">%/yr<br />
    <label for="doors">Property Type: </label><select id="doors">
      <option value="1">Single-Family</option>
      <option value="2">Duplex</option>
      <option value="3">Triplex</option>
      <option value="4">Fourplex</option>
    </select><br /><br />
    <label for="Section8"><input id="Section8" type="checkbox"/>Include Section8 Rent</label><!--https://stackoverflow.com/a/6293626--><br />
    <div id="section8options" hidden>
      <label for="beds">Bedrooms: </label><input type="number" id="beds" value="3" style="width: 30px;"><br />
      <label for="s8maxRent">Max S8 Rent: $</label><input type="number" id="s8maxRent" value="1" style="width: 50px;">/mo<br />
      <label for="s8pcnt">Est. Percent of S8 Max Rent: </label><input type="number" id="s8pcnt" value="75" style="width: 35px;">%<br />
      <label for="s8estRent">Estimated S8 Rent: $</label><input type="number" id="s8estRent" value="1" style="width: 50px;">/mo<br />
    </div><br />
    <label for="financing"><input type="checkbox" id="financing" checked />Finance Purchase</label><br />
    <div id="financingOptions">
      <label for="acPnI"><input type="checkbox" id="acPnI" checked />Auto-Calculate PnI</label><br />
      <label for="down">Down Payment: </label> <input type="number" id="down" value="25" style="width: 35px;">%<br />
      <label for="int">Loan Interest: </label> <input type="number" id="int" value="3.99" style="width: 50px;">%<br />
      <label for="yrs">Loan Term: </label> <input type="number" id="yrs" value="30" style="width: 35px;">yrs<br />
      <label for="pni">Monthly P+I: $</label> <input type="number" id="pni" value="1198.06" style="width: 64px;"><br /><br />
    </div>
  </div>
  <div class="column" style="background-color:#bbb;">
    <h2>Operating Expenses</h2>
    <label for="tax">Property Taxes: </label> <input type="number" id="tax" value="2.016559" style="width: 75px;">%/yr<br />
    <label for="maintenance">Maintenance: </label> <input type="number" id="maintenance" value="0.5" style="width: 42px;">%/yr<br /><!--value="0.4477611940298507"-->
    <label for="pm">Property Management: $</label> <input type="number" id="pm" value="0" style="width: 35px;">/mo<br />
    <label for="hoa">HOA Fees: $</label> <input type="number" id="hoa" value="0" style="width: 55px;">/mo<br />
    <label for="fees">Other Costs: $</label> <input type="number" id="fees" value="0" style="width: 55px;">/mo<br /><br />
    <label for="acIns"><input type="checkbox" id="acIns" checked />Auto-Calculate Insurance</label><br />
    <label for="calcIns">Insurance: </label> <input type="number" id="calcIns" value="0.5" style="width: 65px;">%/yr<br />
    <label for="manIns">Insurance: $</label> <input type="number" id="manIns" value="1800" style="width: 65px;">yr<br />
  </div>
</div>

document.querySelectorAll("input").forEach(elem => elem.addEventListener("input", updateROI));
document.querySelectorAll("select").forEach(elem => elem.addEventListener("input", updateROI));
let feesChanged = false;

function checkURI() {
  let URL = window.location.href.split("?")[1];
  URL = decodeURI(URL);
  let params = URL.split("&");
  
  for (let i=0; i<params.length; i++)
  {
    switch (params[i].split("=")[0]) {
      case "n":
        document.getElementById('purchase').value = params[i].split("=")[1];
        break;
      case "m":
        document.getElementById('market').value = params[i].split("=")[1];
        break;
      case "p":
        document.getElementById('price').value = params[i].split("=")[1];
        break;
      case "z":
        document.getElementById('zip').value = params[i].split("=")[1];
        break;
      case "r":
        document.getElementById('rent').value = params[i].split("=")[1];
        break;
      case "v":
        document.getElementById('vacancy').value = params[i].split("=")[1];
        break;
      case "d":
        document.getElementById('doors').value = params[i].split("=")[1];
        break;
      case "s8":
        document.getElementById('Section8').checked = params[i].split("=")[1];
        break;
      case "b":
        document.getElementById('beds').value = params[i].split("=")[1];
        break;
      case "s8p":
        document.getElementById('s8pcnt').value = params[i].split("=")[1];
        break;
      case "s8m":
        document.getElementById('s8maxRent').value = params[i].split("=")[1];
        break;
      case "s8r":
        document.getElementById('s8estRent').value = params[i].split("=")[1];
        break;
      case "f":
        document.getElementById('financing').checked = params[i].split("=")[1];
        break;
      case "a":
        document.getElementById('acPnI').checked = params[i].split("=")[1];
        break;
      case "d":
        document.getElementById('down').value = params[i].split("=")[1];
        break;
      case "int":
        document.getElementById('int').value = params[i].split("=")[1];
        break;
      case "y":
        document.getElementById('yrs').value = params[i].split("=")[1];
        break;
      case "pni":
        document.getElementById('pni').value = params[i].split("=")[1];
        break;
      case "t":
        document.getElementById('tax').value = params[i].split("=")[1];
        break;
      case "m":
        document.getElementById('maintenance').value = params[i].split("=")[1];
        break;
      case "pm":
        document.getElementById('pm').value = params[i].split("=")[1];
        break;
      case "h":
        document.getElementById('hoa').value = params[i].split("=")[1];
        break;
      case "fees":
        document.getElementById('fees').value = params[i].split("=")[1];
        break;
      case "aci":
        document.getElementById('acIns').checked = params[i].split("=")[1];
        break;
      case "ci":
        document.getElementById('calcIns').value = params[i].split("=")[1];
        break;
      case "mi":
        document.getElementById('manIns').value = params[i].split("=")[1];
        break;
    }
  }

  updateROI();
}

function updateROI(e) {
  document.getElementById('feedbackBox').innerHTML = ""; /* clear feedback box */
  
  if (e) {
    if (e.target.checked !== undefined) {
      if (e.target.id == "Section8") {
        document.getElementById('section8options').style.display = (e.target.checked) ? "block" : "none";
      } else if (e.target.id == "financing") {
        document.getElementById('financingOptions').style.display = (e.target.checked) ? "block" : "none";
      }
    }
    /* Clear initial help text as the user has input something for us to process, and has read this text */
    document.getElementById('initialHelpText').innerHTML = "";
  }

  /* User inputs */
  let purchase = document.getElementById('purchase').value/1 > 0 ? true : false;
  let rent = document.getElementById('rent').value/1;
  let price = document.getElementById('price').value/1;
  let market = purchase ? price : document.getElementById('market').value/1;
  let beds = document.getElementById('beds').value/1;
  let doors = document.getElementById('doors').value/1;
  let pm = doors * document.getElementById('pm').value/1;
  let zip = document.getElementById('zip').value/1;
  if (document.getElementById('zip').value.length < 5) {
    console.error("Invalid zip code: "+zip+", not enough digits, exiting...");
    document.getElementById('feedbackBox').innerHTML = "<h2>ERROR: Zip Code too short ("+zip+"), please enter 5 digits and try again.</h2>";
    document.getElementById('PTCF').textContent = "";
    return; /* Ensure this is a valid zip code before proceeding */
  }
  let s8pcnt = document.getElementById('s8pcnt').value/100;
  let s8maxRent,s8estRent;
  if (document.getElementById("Section8").checked) {
    document.getElementById('s8maxRent').value = s8nTXrents[zip][beds];
    document.getElementById('s8estRent').value = s8nTXrents[zip][beds] * s8pcnt;
    s8estRent = document.getElementById('s8estRent').value;
    if (s8estRent > rent) {
      document.getElementById('feedbackBox').innerHTML += "<h3>Calculating with higher estimated Section 8 monthly rent ("+s8estRent+") instead of inputted estimated monthly rent of "+rent+".</h3>";
      rent = s8estRent;
    }
  }
  let hoa = document.getElementById('hoa').value/1;
  let downPcnt = document.getElementById('down').value/100;
  let intMoPcnt = document.getElementById('int').value/(12*100);
  let yrs = document.getElementById('yrs').value/1;
  
  /* Location dependent variables */
  let vacancy = rent * document.getElementById('vacancy').value/100;
  let maintenance = doors * market * document.getElementById('maintenance').value/(12*100);
  let taxPcnt;
  if (ZipCityCountyTX[zip][2] !== undefined) {
    taxPcnt = ZipCityCountyTX[zip][2]/(12*100);
    document.getElementById('tax').value = ZipCityCountyTX[zip][2];
    document.getElementById('feedbackBox').innerHTML += "<b><i>Successfully found "+ZipCityCountyTX[zip][0]+" Property Tax Rate: "+ZipCityCountyTX[zip][2]+"%, updated input field</b></i><br />";
  } else {
    taxPcnt = document.getElementById('tax').value/(12*100);
    document.getElementById('feedbackBox').innerHTML += "Unable to look up "+ZipCityCountyTX[zip][0]+" Property Tax Rate, defaulting to User Input: "+document.getElementById('tax').value+"%";
  }
  let fees = document.getElementById('fees').value/1;
  if (fees == 0 && ZipCityCountyTX[zip][0] == "Rowlett") {
    document.getElementById('fees').value = ZipCityCountyTX[zip][3]/1;
    document.getElementById('feedbackBox').innerHTML += "Looks like you forgot to include Rowlett's rental license annual fees, updated 'Other Costs' to include these";
    feesChanged = true;
  } else if (feesChanged) { /* If we changed fees previously, revert them now */
    document.getElementById('fees').value = 0;
    fees = 0;
  }
  
  /* Calculations */
  let PrincInt = 0, TaxInsCost = market;
  if (document.getElementById('acIns').checked) {
    TaxInsCost = market * (taxPcnt + document.getElementById('calcIns').value/(12*100));
    console.log("Calculated TaxInsCost as: "+TaxInsCost);
  } else {
    TaxInsCost = (market * taxPcnt + document.getElementById('manIns').value/1)/12;
    console.log("Calculated TaxInsCost as: "+TaxInsCost+", from manIns: "+document.getElementById('manIns').value/1+", taxPcnt: "+taxPcnt);
  }
  let OpEx = TaxInsCost + pm + hoa + fees + maintenance;
  if (document.getElementById("financing").checked) {
    if (document.getElementById("acPnI").checked) {
      PrincInt = (price *(1 - downPcnt)*intMoPcnt) / (1- Math.pow(1+intMoPcnt, yrs*-12));
      document.getElementById('pni').value = Math.round(PrincInt * 100) / 100;
    } else {PrincInt = document.getElementById("pni").value/1;}
  } else {PrincInt = 0;}
  //let NOImo = rent - vacancy - OpEx;
  let PTCF = Math.trunc(100 * (rent - (vacancy + OpEx + PrincInt)))/100;
  document.getElementById('PTCF').textContent = "Pre-Tax Cashflow: $"+PTCF+" per month";
  
  /* Update URL parameters for URL saving and sharing */
  var uri = window.location.href.split("?")[0];
  /* Only print remaining params if they aren't default values */
  if (document.getElementById('purchase').value/1 != 1) uri += "&n="+document.getElementById('purchase').value;
  if (document.getElementById('market').value/1 != 335000) uri += "&m="+document.getElementById('market').value;
  if (document.getElementById('price').value/1 != 335000) uri += "&p="+document.getElementById('price').value;
  if (document.getElementById('zip').value/1 != 75075) uri += "&z="+document.getElementById('zip').value;
  if (document.getElementById('rent').value/1 != 1) uri += "&r="+document.getElementById('rent').value;
  if (document.getElementById('vacancy').value/1 != 3.29) uri += "&v="+document.getElementById('vacancy').value;
  if (document.getElementById('doors').value/1 != 1) uri += "&d="+document.getElementById('doors').value;
  if (document.getElementById('Section8').checked != false) uri += "&s8="+document.getElementById('Section8').checked;
  if (document.getElementById('beds').value/1 != 3) uri += "&b="+document.getElementById('beds').value;
  if (document.getElementById('s8pcnt').value/1 != 75) uri += "&s8p="+document.getElementById('s8pcnt').value;
  if (document.getElementById('s8maxRent').value/1 != 1) uri += "&s8m="+document.getElementById('s8maxRent').value;
  if (document.getElementById('s8estRent').value/1 != 1) uri += "&s8r="+document.getElementById('s8estRent').value;
  if (document.getElementById('financing').checked != true) uri += "&f="+document.getElementById('financing').checked;
  if (document.getElementById('acPnI').checked != true) uri += "&a="+document.getElementById('acPnI').checked;
  if (document.getElementById('down').value/1 != 25) uri += "&d="+document.getElementById('down').value;
  if (document.getElementById('int').value/1 != 3.99) uri += "&int="+document.getElementById('int').value;
  if (document.getElementById('yrs').value/1 != 30) uri += "&y="+document.getElementById('yrs').value;
  if (document.getElementById('pni').value/1 != 1198.06) uri += "&pni="+document.getElementById('pni').value;
  if (document.getElementById('tax').value/1 != 2.016559) uri += "&t="+document.getElementById('tax').value;
  if (document.getElementById('maintenance').value/1 != 0.5) uri += "&m="+document.getElementById('maintenance').value;
  if (document.getElementById('pm').value/1 != 0) uri += "&pm="+document.getElementById('pm').value;
  if (document.getElementById('pm').value/1 != 0) uri += "&pm="+document.getElementById('pm').value;
  if (document.getElementById('hoa').value/1 != 0) uri += "&h="+document.getElementById('hoa').value;
  if (document.getElementById('fees').value/1 != 0) uri += "&fees="+document.getElementById('fees').value;
  if (document.getElementById('acIns').checked != true) uri += "&aci="+document.getElementById('acIns').checked;
  if (document.getElementById('calcIns').value/1 != 0.5) uri += "&ci="+document.getElementById('calcIns').value;
  if (document.getElementById('manIns').value/1 != 1800) uri += "&mi="+document.getElementById('manIns').value;
  uri = encodeURI(uri);
  console.log("uri generated as:"+uri);
  /* Update title and description to improve SEO for chosen mon */
  var newTitle = ZipCityCountyTX[zip][0] + "Invement Property Rental Return";
  window.history.pushState(null, newTitle, uri);
}
